from others.find_the_difference.find_the_difference import find_the_difference


def test_find_the_difference():
    s = "abcd"
    t = "abcde"

    assert find_the_difference(s, t) == "e"

    s = ""
    t = "y"

    assert find_the_difference(s, t) == "y"

    s = ""
    t = ""

    assert find_the_difference(s, t) == "t"
